<?xml version='1.0' encoding='utf-8'?>
<graphml xmlns="http://graphml.graphdrawing.org/xmlns" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xsi:schemaLocation="http://graphml.graphdrawing.org/xmlns http://graphml.graphdrawing.org/xmlns/1.0/graphml.xsd">
  <key id="subnet" for="node" attr.name="subnet" attr.type="string" />
  <graph edgedefault="undirected">
    <node id="net_subnet1" />
    <node id="net_subnet2" />
    <node id="n1" />
    <node id="n2" />
    <node id="n3" />
    <node id="n4" />
    <node id="n5" />

    <edge source="net_subnet1" target="n1" />
    <edge source="net_subnet1" target="n2" />
    <edge source="net_subnet2" target="n2" />
    <edge source="net_subnet2" target="n3" />
    <edge source="net_subnet2" target="n4" />
    <edge source="net_subnet1" target="n5" />

  </graph>
</graphml>
